import json


def unassigned(data, as_json=False):
    unassigned_ips = []

    # Check if data is a list or a dictionary
    if isinstance(data, dict):
        ip_addresses = data.get('ips', [])
    elif isinstance(data, list):
        ip_addresses = data
    else:
        return []

    # Filter out IP addresses with no assigned users
    for ip in ip_addresses:
        if ip.get('subuser_count', 0) == 0:
            unassigned_ips.append(ip)

    # Return the result in the requested format
    if as_json:
        return json.dumps(unassigned_ips)
    else:
        return unassigned_ips

